import React from 'react';
import './Dashboard.css';
import Sidebar from './Sidebar';

const Dashboard = () => {
  return (
    <div className="dashboard">
      <Sidebar />
      <div className="content">
        <h2>Welcome to the Dashboard!</h2>
        <p>This is the content area.</p>
      </div>
    </div>
  );
};

  export default Dashboard;
